DROP TABLE IF EXISTS `cmf_nav_menu`;
CREATE TABLE `cmf_nav_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nav_id` int(11) NOT NULL COMMENT '导航 id',
  `parent_id` int(11) NOT NULL COMMENT '父 id',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态;1:显示;0:隐藏',
  `list_order` float NOT NULL DEFAULT '10000' COMMENT '排序',
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '菜单名称',
  `target` varchar(10) NOT NULL DEFAULT '' COMMENT '打开方式',
  `href` varchar(100) NOT NULL DEFAULT '' COMMENT '链接',
  `icon` varchar(20) NOT NULL DEFAULT '' COMMENT '图标',
  `path` varchar(255) NOT NULL DEFAULT '' COMMENT '层级关系',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COMMENT='前台导航菜单表';

-- ----------------------------
-- Records of cmf_nav_menu
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_option
-- ----------------------------
DROP TABLE IF EXISTS `cmf_option`;
CREATE TABLE `cmf_option` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `autoload` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '是否自动加载;1:自动加载;0:不自动加载',
  `option_name` varchar(64) NOT NULL DEFAULT '' COMMENT '配置名',
  `option_value` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci COMMENT '配置值',
  PRIMARY KEY (`id`),
  UNIQUE KEY `option_name` (`option_name`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='全站配置表';

-- ----------------------------
-- Records of cmf_option
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_order
-- ----------------------------
DROP TABLE IF EXISTS `cmf_order`;
CREATE TABLE `cmf_order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `userid` int(10) unsigned NOT NULL COMMENT '会员ID',
  `orderid` varchar(50) NOT NULL COMMENT '订单ID',
  `inputtime` int(10) unsigned NOT NULL COMMENT '下订单时间',
  `pay_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '支付状态:0未支付,1已支付,2取消订单3,退款状态,4已完成',
  `pay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '支付时间',
  `total_price` decimal(10,2) unsigned NOT NULL COMMENT '订单总价',
  `total_actual` decimal(10,2) NOT NULL COMMENT '实际总价',
  `coupon` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '优惠',
  `discount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '折扣',
  `freight` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '运费',
  `points` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '积分',
  `pay_style` tinyint(3) NOT NULL DEFAULT '0' COMMENT '订单方式:0未支付,1微信,2余额',
  `order_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '订单状态:0未确认,1确认订单,2销毁订单,3退款处理',
  `receiver_name` varchar(50) NOT NULL COMMENT '收货人姓名',
  `receiver_province` varchar(50) NOT NULL COMMENT '地址所属省',
  `receiver_city` varchar(50) NOT NULL COMMENT '地址所属市',
  `receiver_area` varchar(50) NOT NULL COMMENT '地址所属区县',
  `receiver_address` varchar(200) NOT NULL COMMENT '详细地址',
  `receiver_mobile` varchar(20) NOT NULL COMMENT '收货人电话',
  `post_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '发货状态:0:未发货,1:已发货,2:已收货,3:已取消',
  `post_number` varchar(30) NOT NULL DEFAULT '' COMMENT '快递单号',
  `post_time` int(10) NOT NULL DEFAULT '0' COMMENT '发货时间',
  `post_logistics` varchar(50) NOT NULL DEFAULT '' COMMENT '配送物流',
  `message` varchar(250) DEFAULT NULL COMMENT '客户留言',
  `is_evaluate` tinyint(3) NOT NULL DEFAULT '0' COMMENT '0是还有未评价1是已完全评论',
  `is_refund` tinyint(3) NOT NULL DEFAULT '0' COMMENT '0未退款1已退款成功',
  `post_times` int(10) NOT NULL DEFAULT '0' COMMENT '收货时间',
  `is_del` int(3) NOT NULL DEFAULT '0' COMMENT '''正常'',''删除''',
  PRIMARY KEY (`id`),
  KEY `userid` (`userid`)
) ENGINE=InnoDB AUTO_INCREMENT=426 DEFAULT CHARSET=utf8 COMMENT='订单基本信息表';

-- ----------------------------
-- Records of cmf_order
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_order_bill
-- ----------------------------
DROP TABLE IF EXISTS `cmf_order_bill`;
CREATE TABLE `cmf_order_bill` (
  `lid` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `oid` int(11) NOT NULL COMMENT '订单表ID关联',
  `l_name` varchar(50) NOT NULL COMMENT '收货人',
  `l_mobile` varchar(20) NOT NULL COMMENT '联系电话',
  `l_number` varchar(30) NOT NULL COMMENT '快递单号',
  `l_logistics` varchar(30) NOT NULL DEFAULT '0' COMMENT '配送物流',
  `l_time` int(10) NOT NULL DEFAULT '0' COMMENT '发货时间',
  `l_order` varchar(200) NOT NULL COMMENT '订单编号',
  `l_inputtime` int(10) NOT NULL DEFAULT '0' COMMENT '下单时间',
  `l_address` varchar(200) NOT NULL COMMENT '详细地址',
  `l_status` tinyint(3) NOT NULL DEFAULT '1' COMMENT '发货状态:1已发货,2已收货',
  `is_evaluate` tinyint(3) NOT NULL DEFAULT '0' COMMENT '0:正常,1:退款,2:已退款',
  `l_times` int(10) NOT NULL DEFAULT '0' COMMENT '收货时间',
  PRIMARY KEY (`lid`)
) ENGINE=InnoDB AUTO_INCREMENT=84 DEFAULT CHARSET=utf8 COMMENT='订单发货表';

-- ----------------------------
-- Records of cmf_order_bill
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_order_detail
-- ----------------------------
DROP TABLE IF EXISTS `cmf_order_detail`;
CREATE TABLE `cmf_order_detail` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `orderid` varchar(50) NOT NULL COMMENT '订单ID',
  `goods_id` int(10) unsigned NOT NULL COMMENT '商品ID',
  `goods_attr_id` varchar(20) NOT NULL COMMENT '商品属性ID',
  `goods_attr_value` varchar(100) DEFAULT NULL COMMENT '商品属性值',
  `goods_price` decimal(10,2) NOT NULL COMMENT '单价',
  `num` int(10) unsigned NOT NULL COMMENT '购买数量',
  `is_evaluate` tinyint(3) NOT NULL DEFAULT '0' COMMENT '0是待评价1是已评价',
  PRIMARY KEY (`id`),
  KEY `orderid` (`orderid`)
) ENGINE=InnoDB AUTO_INCREMENT=377 DEFAULT CHARSET=utf8 COMMENT='订单商品详情';

-- ----------------------------
-- Records of cmf_order_detail
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_order_invoice
-- ----------------------------
DROP TABLE IF EXISTS `cmf_order_invoice`;
CREATE TABLE `cmf_order_invoice` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `order_id` varchar(50) NOT NULL COMMENT '订单ID',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '发票类型：0个人,1公司',
  `company` varchar(200) NOT NULL DEFAULT '' COMMENT '公司名称/姓名',
  `number` varchar(50) NOT NULL DEFAULT '' COMMENT '纳税人识别号',
  `tel` varchar(20) NOT NULL COMMENT '手机号',
  `email` varchar(50) NOT NULL DEFAULT '' COMMENT '邮箱',
  `description` varchar(100) NOT NULL DEFAULT '' COMMENT '描述',
  `pay_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '支付状态0未支付，1已支付',
  `is_evaluate` tinyint(3) NOT NULL DEFAULT '0' COMMENT '退款状态:0是正常,1是退款,2是已成功,3订单取消',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8 COMMENT='订单发票记录';

-- ----------------------------
-- Records of cmf_order_invoice
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_order_refund
-- ----------------------------
DROP TABLE IF EXISTS `cmf_order_refund`;
CREATE TABLE `cmf_order_refund` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主ID',
  `orderid` varchar(50) NOT NULL COMMENT '订单ID',
  `username` varchar(50) NOT NULL COMMENT '姓名',
  `tel` varchar(50) NOT NULL COMMENT '电话',
  `order_money` decimal(10,2) NOT NULL COMMENT '退款金额',
  `order_explain` varchar(255) DEFAULT NULL COMMENT '退款说明',
  `is_evaluate` tinyint(3) DEFAULT '0' COMMENT '''1''退款处理中,''2''退款成功,''3''取消退款',
  `createtime` int(10) NOT NULL COMMENT '退款时间',
  `updatetime` int(10) DEFAULT '0' COMMENT '处理时间',
  `is_operation` tinyint(3) DEFAULT '0' COMMENT '''0''用户退款',
  `content` varchar(255) DEFAULT NULL COMMENT '后台操作退款说明',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=70 DEFAULT CHARSET=utf8 COMMENT='退款处理';

-- ----------------------------
-- Records of cmf_order_refund
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_plugin
-- ----------------------------
DROP TABLE IF EXISTS `cmf_plugin`;
CREATE TABLE `cmf_plugin` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '插件类型;1:网站;8:微信',
  `has_admin` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否有后台管理,0:没有;1:有',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态;1:开启;0:禁用',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '插件安装时间',
  `name` varchar(50) NOT NULL DEFAULT '' COMMENT '插件标识名,英文字母(惟一)',
  `title` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '插件名称',
  `demo_url` varchar(50) NOT NULL DEFAULT '' COMMENT '演示地址，带协议',
  `hooks` varchar(255) NOT NULL DEFAULT '' COMMENT '实现的钩子;以“,”分隔',
  `author` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '插件作者',
  `author_url` varchar(50) NOT NULL DEFAULT '' COMMENT '作者网站链接',
  `version` varchar(20) NOT NULL DEFAULT '' COMMENT '插件版本号',
  `description` varchar(255) NOT NULL COMMENT '插件描述',
  `config` text COMMENT '插件配置',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COMMENT='插件表';

-- ----------------------------
-- Records of cmf_plugin
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_portal_category
-- ----------------------------
DROP TABLE IF EXISTS `cmf_portal_category`;
CREATE TABLE `cmf_portal_category` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '分类id',
  `parent_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '分类父id',
  `post_count` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '分类文章数',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态,1:发布,0:不发布',
  `delete_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '删除时间',
  `list_order` float NOT NULL DEFAULT '10000' COMMENT '排序',
  `name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '分类名称',
  `description` varchar(255) NOT NULL DEFAULT '' COMMENT '分类描述',
  `path` varchar(255) NOT NULL DEFAULT '' COMMENT '分类层级关系路径',
  `seo_title` varchar(100) NOT NULL DEFAULT '',
  `seo_keywords` varchar(255) NOT NULL DEFAULT '',
  `seo_description` varchar(255) NOT NULL DEFAULT '',
  `list_tpl` varchar(50) NOT NULL DEFAULT '' COMMENT '分类列表模板',
  `one_tpl` varchar(50) NOT NULL DEFAULT '' COMMENT '分类文章页模板',
  `more` text COMMENT '扩展属性',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COMMENT='portal应用 文章分类表';

-- ----------------------------
-- Records of cmf_portal_category
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_portal_category_post
-- ----------------------------
DROP TABLE IF EXISTS `cmf_portal_category_post`;
CREATE TABLE `cmf_portal_category_post` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `post_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '文章id',
  `category_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '分类id',
  `list_order` float NOT NULL DEFAULT '10000' COMMENT '排序',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态,1:发布;0:不发布',
  PRIMARY KEY (`id`),
  KEY `term_taxonomy_id` (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8 COMMENT='portal应用 分类文章对应表';

-- ----------------------------
-- Records of cmf_portal_category_post
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_portal_post
-- ----------------------------
DROP TABLE IF EXISTS `cmf_portal_post`;
CREATE TABLE `cmf_portal_post` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '父级id',
  `post_type` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '类型,1:文章;2:页面',
  `post_format` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '内容格式;1:html;2:md',
  `user_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '发表者用户id',
  `post_status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态;1:已发布;0:未发布;',
  `comment_status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '评论状态;1:允许;0:不允许',
  `is_top` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否置顶;1:置顶;0:不置顶',
  `recommended` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否推荐;1:推荐;0:不推荐',
  `post_hits` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '查看数',
  `post_like` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '点赞数',
  `comment_count` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '评论数',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `published_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '发布时间',
  `delete_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '删除时间',
  `post_title` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'post标题',
  `post_keywords` varchar(150) NOT NULL DEFAULT '' COMMENT 'seo keywords',
  `post_excerpt` varchar(500) NOT NULL DEFAULT '' COMMENT 'post摘要',
  `post_source` varchar(150) NOT NULL DEFAULT '' COMMENT '转载文章的来源',
  `post_content` text COMMENT '文章内容',
  `post_content_filtered` text COMMENT '处理过的文章内容',
  `more` text COMMENT '扩展属性,如缩略图;格式为json',
  PRIMARY KEY (`id`),
  KEY `type_status_date` (`post_type`,`post_status`,`create_time`,`id`),
  KEY `parent_id` (`parent_id`),
  KEY `user_id` (`user_id`),
  KEY `create_time` (`create_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='portal应用 文章表';

-- ----------------------------
-- Records of cmf_portal_post
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_portal_tag
-- ----------------------------
DROP TABLE IF EXISTS `cmf_portal_tag`;
CREATE TABLE `cmf_portal_tag` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '分类id',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态,1:发布,0:不发布',
  `recommended` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否推荐;1:推荐;0:不推荐',
  `post_count` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '标签文章数',
  `name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '标签名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4 COMMENT='portal应用 文章标签表';

-- ----------------------------
-- Records of cmf_portal_tag
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_portal_tag_post
-- ----------------------------
DROP TABLE IF EXISTS `cmf_portal_tag_post`;
CREATE TABLE `cmf_portal_tag_post` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `tag_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '标签 id',
  `post_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '文章 id',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态,1:发布;0:不发布',
  PRIMARY KEY (`id`),
  KEY `post_id` (`post_id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='portal应用 标签文章对应表';

