-- ----------------------------
-- Table structure for cmf_put_card
-- ----------------------------
DROP TABLE IF EXISTS `cmf_put_card`;
CREATE TABLE `cmf_put_card` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `userid` int(10) unsigned NOT NULL COMMENT '会员ID',
  `name` varchar(100) NOT NULL COMMENT '姓名',
  `money` decimal(10,2) NOT NULL COMMENT '金额',
  `cardid` varchar(30) NOT NULL COMMENT '银行卡号',
  `cardname` varchar(50) NOT NULL COMMENT '开户银行',
  `inputtime` int(10) unsigned NOT NULL COMMENT '申请时间',
  `pass_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '审核时间',
  `status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '状态:0未审核，1审核,2，拒绝',
  `admin_userid` int(10) unsigned DEFAULT NULL COMMENT '审核人',
  PRIMARY KEY (`id`)
