  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `userid` int(10) unsigned NOT NULL COMMENT '会员ID',
  `money` decimal(10,2) NOT NULL COMMENT '提现金额',
  `inputtime` int(10) unsigned NOT NULL COMMENT '申请时间',
  `pass_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '通过时间',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '状态:0待审核,1通过审核,2拒绝',
  `orderid` varchar(50) NOT NULL COMMENT '提现订单',
  `transaction_id` varchar(50) DEFAULT NULL COMMENT '微信交易记录',
