-- ----------------------------
-- Records of cmf_put_forward
-- ----------------------------

-- ----------------------------
-- Table structure for cmf_recharge
-- ----------------------------
DROP TABLE IF EXISTS `cmf_recharge`;
CREATE TABLE `cmf_recharge` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `userid` int(10) unsigned NOT NULL COMMENT '会员ID',
  `money` decimal(10,2) unsigned NOT NULL COMMENT '充值金额',
  `pay_method` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '支付方式:1微信',
  `inputtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '时间',
  `orderid` varchar(50) NOT NULL DEFAULT '' COMMENT '订单ID',
  `transaction_id` varchar(50) DEFAULT NULL COMMENT '微信交易记录',
  `type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '充值方式:0会员充值,1管理员后台充值',
