  `log_name` varchar(50) NOT NULL COMMENT '操作名称',
  `remarks` varchar(300) NOT NULL DEFAULT '' COMMENT '备注',
  `time` int(10) unsigned NOT NULL COMMENT '操作时间',
  `admin_userid` int(10) DEFAULT NULL COMMENT '后台操作人',
