INSERT INTO `cmf_message` VALUES ('3', '2', '0', '1,2,4', '1527843573', '福利到!', '&lt;p&gt;&lt;span style=\'color: rgb(43, 43, 43); font-family: &quot;Helvetica Neue&quot;, Verdana, Arial, &quot;Hiragino Sans GB&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Heiti SC&quot;, STHeiti, &quot;Microsoft Yahei&quot;, SimSun, sans-serif; text-indent: 32px;\'&gt;5月31日，习近平总书记主持召开中央政治局会议，审议《关于打赢脱贫攻坚战三年行动的指导意见》，对未来三年打赢脱贫攻坚战作出全面部署，明确要求确保坚决打赢脱贫这场对如期全面建成小康社会、实现第一个百年奋斗目标具有决定性意义的攻坚战。离2020年还有不到三年时间，时不我待，必须凝聚共识，进而凝心聚力，坚决打赢脱贫攻坚战。&lt;/span&gt;&lt;/p&gt;', '1');
INSERT INTO `cmf_message` VALUES ('4', '3', '1', '2', '1527844124', '年终大促销', '&lt;p&gt;&lt;span style=\'color: rgb(43, 43, 43); font-family: &quot;Helvetica Neue&quot;, Verdana, Arial, &quot;Hiragino Sans GB&quot;, &quot;WenQuanYi Micro Hei&quot;, &quot;Heiti SC&quot;, STHeiti, &quot;Microsoft Yahei&quot;, SimSun, sans-serif; text-indent: 32px;\'&gt;5月31日，习近平总书记主持召开中央政治局会议，审议《关于打赢脱贫攻坚战三年行动的指导意见》，对未来三年打赢脱贫攻坚战作出全面部署，明确要求确保坚决打赢脱贫这场对如期全面建成小康社会、实现第一个百年奋斗目标具有决定性意义的攻坚战。离2020年还有不到三年时间，时不我待，必须凝聚共识，进而凝心聚力，坚决打赢脱贫攻坚战。&lt;/span&gt;&lt;/p&gt;', '1');
INSERT INTO `cmf_message` VALUES ('8', '2', '1', '6,11', '1528431578', '我觉得应该发点福利', '&lt;p&gt;你觉得呢？&lt;/p&gt;', '1');
INSERT INTO `cmf_message` VALUES ('9', '2', '1', '2', '1529914061', '会员全场大酬宾会员全场大酬宾', '\n&lt;p&gt;参赛的32强每支都可以获得150万美元的出场费，小组出线队伍获得800万美元，晋级8强再拿到1200万美元，四强球队最终能分得3800万、2800万、2400万和2200万美元。剩下的钱中的2.09亿美元会用于一项名为“俱乐部收益计划”，就是分发给参加世界杯球员所在的俱乐部。另有1.34亿美元用于另一个项目──俱乐部保障计划。球员在世界杯期间受伤，国际足联要对其所在俱乐部赔偿，最高将获得3800万美元的奖金，比2014年的3500万美元有所增加。&amp;lt;/br&amp;gt;&amp;lt;/br&amp;gt;&lt;br&gt;&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n&lt;p&gt;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;事实上，国际足联在奖金分配方案中体现了一个思路──球员、俱乐部并重。也就是说，国际足联高度重视球员背后支持者的利益，不得不承认，国际足联的情商实在是高。&amp;lt;/br&amp;gt;&amp;lt;/br&amp;gt;&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n&lt;p&gt;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;球队方面，西班牙队的奖金是最高的，如果夺冠每个队员将拿到94万美元，如果他们无法进入四强，球员除了最基本的出场费，一无所有。德国队如能卫冕成功，每名球员至少能拿到41万美元，如果决赛失利，奖金降至每人23万美元，进入四强的奖金是每人15万美元，如果止步八强则每名队员只能领到9万美元的“安慰奖”。另一支夺冠热门法国队捧杯，每人可得67万美元，比利时如果历史性夺冠，每人会领到80万美元。&amp;lt;/br&amp;gt;&amp;lt;/br&amp;gt;&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n&lt;p&gt;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;&amp;amp;nbsp;总体来说，各国足协为了能登上世界巅峰，可谓是下了血本。但与金钱相比，能够代表自己国家夺取世界最高荣誉，显然比金钱更能激发球员的斗志。&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n', '1');
INSERT INTO `cmf_message` VALUES ('10', '3', '1', '2,6', '1529916475', '首支出局的种子队的最新相关信息', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial; font-size: 13px; background-color: rgb(255, 255, 255);&quot;&gt;世界杯最弱种子队出局:虽然世界排名高居第8,但波兰前2战的表现没有让人看出强队水平,2战2败的他们成为本届世界杯&lt;/span&gt;&lt;span style=&quot;color: rgb(204, 0, 0); font-family: arial; font-size: 13px; background-color: rgb(255, 255, 255);&quot;&gt;首支出局的种子队&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial; font-size: 13px; background-color: rgb(255, 255, 255);&quot;&gt;和欧洲球队。巴萨.&lt;/span&gt;&lt;/p&gt;', '1');
