INSERT INTO `cmf_portal_post` VALUES ('11', '0', '1', '1', '1', '1', '1', '1', '0', '72', '0', '0', '1528689508', '1529553379', '1528689420', '0', '优惠促销1，满500元减100元', '促销', '', '', '\n&lt;p style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;background-color: rgb(255, 255, 255); color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px;&quot;&gt;自4月27日10:00起，京东将开展“开通京东PLUS年卡，同步尊享爱奇艺VIP年卡权益”的活动，新开通或续费一年的京东PLUS会员，点击领取即可享受价值198元的爱奇艺VIP会员年卡权益。&lt;/span&gt;&lt;/p&gt;\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br&gt;这是一个全新上线的PLUS会员权益，这意味着，京东PLUS会员不仅拥有例如360元/年的运费券礼包、免费上门退换货、9折服饰品类券、100元全品类专享券、和数以百万计的专享价商品等关于“买买买”的权益，还能够同时享受到由爱奇艺提供的视频及娱乐服务：成为爱奇艺VIP会员，既可线上观看电影、戏剧、演唱会直播、纪录片、动漫等海量优质内容，更可享受到生日礼包、升级礼包、高性价比电影票、VIP专场明星见面会等更多专属特权；同时，爱奇艺VIP会员还可体验到在影视片库资源、院线新片覆盖率、会员特权等多方面会员专属娱乐服务。&lt;/p&gt;\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br&gt;随着爱奇艺VIP会员权益的加入，相信原先平均能为会员节省600多元/年的京东PLUS会员，具有了更强的“省钱”能力，也将会员“福利”的使用场景延伸到了京东平台之外。未来，京东PLUS会员还会不断引入更多元化的增值服务和跨界权益，在继续帮助会员享受“买买买”优质体验和服务的同时，也为会员的日常生活带来更多“小确幸”。&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n', null, '{\"thumbnail\":\"portal\\/20180613\\/bed5b382ff2bc7ff1298f79c2d4643bd.png\",\"template\":\"\"}');
INSERT INTO `cmf_portal_post` VALUES ('12', '0', '1', '1', '1', '1', '1', '0', '0', '43', '0', '0', '1528689533', '1528700015', '1528689480', '0', '京东PLUS会员权益更新及会费调整', '', '', '', '\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;自4月27日10:00起，京东将开展“开通京东PLUS年卡，同步尊享爱奇艺VIP年卡权益”的活动，新开通或续费一年的京东PLUS会员，点击领取即可享受价值198元的爱奇艺VIP会员年卡权益。&lt;/p&gt;\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br&gt;这是一个全新上线的PLUS会员权益，这意味着，京东PLUS会员不仅拥有例如360元/年的运费券礼包、免费上门退换货、9折服饰品类券、100元全品类专享券、和数以百万计的专享价商品等关于“买买买”的权益，还能够同时享受到由爱奇艺提供的视频及娱乐服务：成为爱奇艺VIP会员，既可线上观看电影、戏剧、演唱会直播、纪录片、动漫等海量优质内容，更可享受到生日礼包、升级礼包、高性价比电影票、VIP专场明星见面会等更多专属特权；同时，爱奇艺VIP会员还可体验到在影视片库资源、院线新片覆盖率、会员特权等多方面会员专属娱乐服务。&lt;/p&gt;\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br&gt;随着爱奇艺VIP会员权益的加入，相信原先平均能为会员节省600多元/年的京东PLUS会员，具有了更强的“省钱”能力，也将会员“福利”的使用场景延伸到了京东平台之外。未来，京东PLUS会员还会不断引入更多元化的增值服务和跨界权益，在继续帮助会员享受“买买买”优质体验和服务的同时，也为会员的日常生活带来更多“小确幸”。&lt;/p&gt;\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br&gt;同时，为了更好地为广大会员开展服务，提供更丰富的惊喜权益，在“开通京东PLUS年卡，同步尊享爱奇艺VIP年卡权益”活动上线当天，京东将对购买PLUS会员年费的折扣力度进行调整，即在PLUS会员年费维持￥299不变的前提下，用户购买的折扣价格由￥149调整为￥198。即日起新开通或续费的PLUS会员仍然可以根据账户等级的不同，享受相应的优惠价。详情可查看京东商城PLUS会员频道:&lt;a href=&quot;https://plus.jd.com/&quot; target=&quot;_blank&quot; style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); text-decoration-line: none;&quot;&gt;plus.jd.com&lt;/a&gt;&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n', null, '{\"thumbnail\":\"\",\"template\":\"\"}');
INSERT INTO `cmf_portal_post` VALUES ('13', '0', '1', '1', '1', '1', '1', '0', '0', '56', '0', '0', '1528689563', '1528689584', '1528689480', '0', '关于召回普利司通（天津）轮胎有限公司2个规格乘用车轮胎的公告', '', '', '', '\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;尊敬的各位京东用户，&lt;/p&gt;\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br&gt;&lt;/p&gt;\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;2017年11月15日普利司通（天津）轮胎有限公司宣布，召回其于2016年5月至2017年5月期间制造的普利司通品牌TECHNO系列乘用车轮胎的2个规格商品：185/60 R14 82H TECHNO（TEC1Z）、195/60 R14 86H TECHNO （TEC1Z）。&lt;/p&gt;\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br&gt;&lt;/p&gt;\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;普利司通公司召回通知称，本次召回的轮胎在生产过程中出现问题，有强度不足的可能性，存在安全隐患。京东一直秉持用户为先的价值观，本着对用户负责的精神，我们将以最快的速度协助用户对所有召回范围内的轮胎进行免费更换。我们的客服会与您联系，协助您更换轮胎，或者您也可以参考普利司通官方召回公告了解更多信息：&lt;a href=&quot;https://www.bridgestone.com.cn/aboutbridgestone/news/article.html?id=176&quot; target=&quot;_blank&quot; style=&quot;margin: 0px; padding: 0px; color: rgb(102, 102, 102); text-decoration-line: none;&quot;&gt;https://www.bridgestone.com.cn/aboutbridgestone/news/article.html?id=176&lt;/a&gt;&lt;/p&gt;\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;br&gt;&lt;/p&gt;\n&lt;p style=&quot;margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: 微软雅黑; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;感谢您的支持。&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n', null, '{\"thumbnail\":\"\",\"template\":\"\"}');
INSERT INTO `cmf_portal_post` VALUES ('14', '0', '1', '1', '1', '1', '1', '0', '0', '42', '0', '0', '1529550778', '1529553120', '1529550720', '0', '水调歌头', '宿舍', '素色', '苏轼', '\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;&lt;img src=&quot;portal/20180613/c3c2d3ef207601a4299434fee1c0d059.png&quot; title=&quot;banner3.png&quot; alt=&quot;banner3.png&quot; width=&quot;213&quot; height=&quot;215&quot; style=&quot;width: 213px; height: 215px;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;《&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E6%B0%B4%E8%B0%83%E6%AD%8C%E5%A4%B4&quot; style=&quot;color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;水调歌头&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;·明月几时有》是&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%AE%8B%E4%BB%A3&quot; style=&quot;color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;宋代&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;大文学家&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E8%8B%8F%E8%BD%BC&quot; style=&quot;color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;苏轼&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;公元1076年（&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%AE%8B%E7%A5%9E%E5%AE%97&quot; style=&quot;color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;宋神宗&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;熙宁九年）&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E4%B8%AD%E7%A7%8B/182203&quot; style=&quot;color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;中秋&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;在密州（今山东省&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E8%AF%B8%E5%9F%8E%E5%B8%82&quot; style=&quot;color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;诸城市&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;）时所作。这首词以月起兴，与其弟&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E8%8B%8F%E8%BE%99&quot; style=&quot;color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;苏辙&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;七年未见之情为基础，围绕中秋明月展开想象和思考，把人世间的悲欢离合之情纳入对宇宙人生的哲理性追寻之中，反映了作者复杂而又矛盾的思想感情，又表现出作者热爱生活与积极向上的乐观精神。词作上片问天反映执著人生，下片问月表现善处人生。落笔潇洒，舒卷自如，情与景融，境与思偕，思想深刻而境界高逸，充满&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E5%93%B2%E7%90%86/992405&quot; style=&quot;color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;哲理&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;，是&lt;/span&gt;&lt;a target=&quot;_blank&quot; href=&quot;https://baike.baidu.com/item/%E8%8B%8F%E8%BD%BC/53906&quot; style=&quot;color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;苏轼&lt;/a&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);&quot;&gt;词的典范之作。&lt;/span&gt;&lt;/p&gt;\n', null, '{\"thumbnail\":\"\",\"template\":\"\"}');
INSERT INTO `cmf_portal_post` VALUES ('15', '0', '1', '1', '1', '1', '1', '0', '0', '13', '0', '0', '1529551145', '1529552582', '1529551080', '0', '滕王阁序', '王勃', '', '', '\n&lt;p&gt;豫章故郡，洪都新府。星分翼轸，地接衡庐。襟三江而带五湖，控蛮荆而引瓯越。物华天宝，龙光射牛斗之墟；&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n&lt;p&gt;人杰地灵，徐孺下陈蕃之榻。雄州雾列，俊采星驰。台隍枕夷夏之交，宾主尽东南之美。都督阎公之雅望，棨戟遥临；&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n&lt;p&gt;宇文新州之懿范，襜帷暂驻。十旬休假，胜友如云；千里逢迎，高朋满座。腾蛟起凤，孟学士之词宗；紫电青霜，王将军之武库。家君作宰，路出名区；童子何知，躬逢胜饯。&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n&lt;p&gt;时维九月，序属三秋。潦水尽而寒潭清，烟光凝而暮山紫。俨骖騑于上路，访风景于崇阿；临帝子之长洲，得天人之旧馆。层峦耸翠，上出重霄；&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n&lt;p&gt;飞阁流丹，下临无地。鹤汀凫渚，穷岛屿之萦回；桂殿兰宫，即冈峦之体势。&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n&lt;p&gt;披绣闼，俯雕甍，山原旷其盈视，川泽纡其骇瞩。闾阎扑地，钟鸣鼎食之家；舸舰弥津，青雀黄龙之舳。&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n&lt;p&gt;云销雨霁，彩彻区明。落霞与孤鹜齐飞，秋水共长天一色。渔舟唱晚，响穷彭蠡之滨；雁阵惊寒，声断衡阳之浦。&lt;/p&gt;\n', null, '{\"thumbnail\":\"\",\"template\":\"\"}');
INSERT INTO `cmf_portal_post` VALUES ('16', '0', '1', '1', '1', '1', '1', '0', '0', '7', '0', '0', '1529722270', '1529722283', '1529722140', '0', '下单后可以修改订单吗？', '', '', '', '\n&lt;p style=\'margin-top: 0px; margin-bottom: 20px; padding: 0px; text-indent: 2em; line-height: 21px; font-family: tahoma, arial, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, u5b8bu4f53, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\'&gt;&lt;span style=&quot;margin: 0px; padding: 0px; font-family: 宋体, SimSun;&quot;&gt;由京东快递发货的自营（非自提）订单，在订单打印之前可以修改，打开“&lt;a href=&quot;https://order.jd.com/center/list.action&quot; target=&quot;_blank&quot; title=&quot;我的订单&quot; style=&quot;margin: 0px; padding: 0px; color: rgb(77, 183, 235); text-decoration-line: none;&quot;&gt;&lt;strong style=&quot;margin: 0px; padding: 0px;&quot;&gt;我的订单&lt;/strong&gt;&lt;/a&gt;”，进入您想修改的“订单详情”页面，点击右上角的“修改订单”即可，若没有修改订单按钮，则表示订单无法修改。&lt;/span&gt;&lt;/p&gt;\n&lt;p style=\'margin-top: 0px; margin-bottom: 20px; padding: 0px; text-indent: 2em; line-height: 21px; font-family: tahoma, arial, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, u5b8bu4f53, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\'&gt;&lt;span style=&quot;margin: 0px; padding: 0px;&quot;&gt;注：&lt;/span&gt;&lt;/p&gt;\n&lt;p style=\'margin-top: 0px; margin-bottom: 20px; padding: 0px; text-indent: 2em; line-height: 21px; font-family: tahoma, arial, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, u5b8bu4f53, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\'&gt;&lt;span style=&quot;margin: 0px; padding: 0px;&quot;&gt;1. 修改订单可能影响送货时间。&lt;/span&gt;&lt;/p&gt;\n&lt;p style=\'margin-top: 0px; margin-bottom: 20px; padding: 0px; text-indent: 2em; line-height: 21px; font-family: tahoma, arial, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, u5b8bu4f53, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\'&gt;&lt;span style=&quot;margin: 0px; padding: 0px;&quot;&gt;2. 修改时将以当前商品信息为准，修改时需要注意查看活动信息。&lt;/span&gt;&lt;/p&gt;\n&lt;p style=\'margin-top: 0px; margin-bottom: 20px; padding: 0px; text-indent: 2em; line-height: 21px; font-family: tahoma, arial, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, u5b8bu4f53, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\'&gt;&lt;span style=&quot;margin: 0px; padding: 0px;&quot;&gt;3. 由于订单生产速度快，可能出现修改不成功的情况。&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n', null, '{\"thumbnail\":\"\",\"template\":\"\"}');
INSERT INTO `cmf_portal_post` VALUES ('17', '0', '1', '1', '1', '1', '1', '0', '0', '9', '0', '0', '1529722323', '1531710040', '1529722260', '0', '订单如何取消呢？', '', '', '', '&lt;p&gt;&lt;span style=&quot;font-family: 宋体, SimSun; font-size: 12px; text-indent: 24px; background-color: rgb(255, 255, 255);&quot;&gt;如订单处于&lt;/span&gt;&lt;span style=&quot;margin: 0px; padding: 0px; font-family: 宋体, SimSun; font-size: 12px; text-indent: 24px; background-color: rgb(255, 255, 255);&quot;&gt;暂停状态，&lt;/span&gt;&lt;span style=&quot;font-family: 宋体, SimSun; font-size: 12px; text-indent: 24px; background-color: rgb(255, 255, 255);&quot;&gt;进入“&lt;/span&gt;&lt;a title=&quot;我的订单页面&quot; href=&quot;https://order.jd.com/center/list.action&quot; target=&quot;_blank&quot; style=&quot;margin: 0px; padding: 0px; color: rgb(77, 183, 235); text-decoration-line: none; font-family: 宋体, SimSun; font-size: 12px; text-indent: 24px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;&lt;strong style=&quot;margin: 0px; padding: 0px;&quot;&gt;我的订单&lt;/strong&gt;&lt;/a&gt;&lt;span style=&quot;font-family: 宋体, SimSun; font-size: 12px; text-indent: 24px; background-color: rgb(255, 255, 255);&quot;&gt;&quot;页面，找到要取消的订单，点击“取消订单”按钮；（如下图）&lt;/span&gt;&lt;/p&gt;', null, '{\"thumbnail\":\"portal\\/20180715\\/38f6478f177b6f041100478cd81de254.jpg\",\"template\":\"\"}');
INSERT INTO `cmf_portal_post` VALUES ('18', '0', '1', '1', '1', '1', '1', '0', '0', '14', '0', '0', '1529722361', '1531624331', '1529722320', '0', '无货商品几天可以到货？', '', '', '', '\n&lt;p style=\'padding: 0px; text-indent: 2em; line-height: 21px; font-family: tahoma, arial, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, u5b8bu4f53, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\'&gt;&lt;span style=&quot;margin: 0px; padding: 0px; font-family: 宋体, SimSun;&quot;&gt;您可以通过以下方法获取商品的到货时间：&lt;/span&gt;&lt;/p&gt;\n&lt;p style=\'padding: 0px; text-indent: 2em; line-height: 21px; font-family: tahoma, arial, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, u5b8bu4f53, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\'&gt;&lt;span style=&quot;margin: 0px; padding: 0px; font-family: 宋体, SimSun;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\n&lt;p style=\'padding: 0px; text-indent: 2em; line-height: 21px; font-family: tahoma, arial, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, u5b8bu4f53, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\'&gt;&lt;span style=&quot;margin: 0px; padding: 0px; font-family: 宋体, SimSun;&quot;&gt;1. 若商品页面中，显示“无货”时：商品具体的到货时间是无法确定的，您可以通过商品页面的“到货通知”功能获得商品到货提醒。（如下图）&lt;/span&gt;&lt;/p&gt;\n&lt;p style=\'padding: 0px; text-indent: 2em; line-height: 21px; font-family: tahoma, arial, &quot;Microsoft YaHei&quot;, &quot;Hiragino Sans GB&quot;, u5b8bu4f53, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\'&gt;&lt;span style=&quot;margin: 0px; padding: 0px;&quot;&gt;&lt;img title=&quot;&quot; alt=&quot;&quot; src=&quot;https://img30.360buyimg.com/pophelp/jfs/t466/61/1237326326/5680/87a57e6/54bf4433N10cc6963.png&quot; style=&quot;margin: 10px 0px 10px -2em; padding: 0px; border: 0px; vertical-align: middle; text-align: center; max-width: 650px;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\n', null, '{\"thumbnail\":\"portal\\/20180715\\/3bb12d23580ab3d25e20c1138c0547ad.png\",\"template\":\"\"}');
